class ESPNDataFetcher {
  constructor() {
    this.baseUrl = "https://site.api.espn.com/apis/site/v2/sports";
    this.leagues = {
      nba: { name: "Basketball", abbrev: "nba", lookback: 60 },
      mlb: { name: "Baseball", abbrev: "mlb", lookback: 60 },
      nhl: { name: "Hockey", abbrev: "nhl", lookback: 60 },
    };
  }

  async fetchData(url) {
    try {
      const response = await axiosClient.get(url);
      return response.data;
    } catch (error) {
      console.error(`Error fetching data from ${url}: ${error.response?.status}`);
      return null;
    }
  }

  async fetchAllTeams(league) {
    const url = `${this.baseUrl}/${this.leagues[league].name.toLowerCase()}/${league}/teams`;
    return await this.fetchData(url);
  }

  async fetchRecentGames(league, startDate, endDate) {
    const url = `${this.baseUrl}/${this.leagues[league].name.toLowerCase()}/${league}/scoreboard?dates=${startDate}-${endDate}`;
    return await this.fetchData(url);
  }

  async getSportsData() {
    // We'll first fetch the data for each in-season league
    for (let leagueKey in allData) {
      const league = allData[leagueKey];

      if (this.leagues[leagueKey]) {
        const lookbackDays = this.leagues[leagueKey].lookback;

        const endDate = new Date();
        const startDate = new Date();
        startDate.setDate(endDate.getDate() - lookbackDays);
        const startStr = startDate.toISOString().split("T")[0].replace(/-/g, "");
        const endStr = endDate.toISOString().split("T")[0].replace(/-/g, "");

        const teamsData = await this.fetchAllTeams(leagueKey);

        const gamesData = await this.fetchRecentGames(leagueKey, startStr, endStr);

        const teamRecentGames = {};
        if (gamesData && gamesData.events) {
          gamesData.events.forEach(event => {
            const competitors = event.competitions[0].competitors;
            const gameDate = new Date(event.date).toLocaleDateString();
            const venue = event.competitions[0].venue.name;

            competitors.forEach(competitor => {
              const teamId = competitor.team.id;
              if (!teamRecentGames[teamId]) {
                teamRecentGames[teamId] = [];
              }

              teamRecentGames[teamId].push({
                id: event.id,
                date: gameDate,
                name: event.competitions[0].name,
                shortName: event.shortName,
                venue: venue,
                scores: competitors.map(c => ({
                  team: c.team.displayName,
                  score: c.score,
                  winner: c.winner,
                })),
              });
            });
          });
        }

        for (let team of league.teams) {
          const teamId = team.id;
          team.recent_games = teamRecentGames[teamId] || []; // Set empty if no recent games
        }
      }
    }

    return allData;
  }
}

export default async function GetSportsData() {
  const fetcher = new ESPNDataFetcher();
  const sportsData = await fetcher.getSportsData();

  // Write the final data to a JSON file
  fs.writeFileSync("sports_data_with_recent_games.json", JSON.stringify(sportsData, null, 2));
  console.log("Data with recent games has been written to 'sports_data_with_recent_games.json'");

  return sportsData;
}

